		if ( !this.box ) { this._create(); }		
		
		// setup the buttons, showing or hiding and adjusting the labels, this is done each
		// time, because the DOM is reused between showing's, we have to be sure the correct
		// labels are on in case the previous instance changed them
		this._btn( this.btnOkYes, this.buttons.ok, 'Ok' );
		this._btn( this.btnNo, this.buttons.no, 'No' );
		this._link( this.cancel, this.buttons.cancel, 'Cancel' );

