Enjin.UI.PageButtons.prototype = {
	
	page: 1,
	totalPages: 1,
	get_page : 'getPage',
	
	/**
	 * Use this config to control the order and type of buttons that appear in your paging widget
	 */
	setup: ['first', 'input', 'prev', 'next', 'last'],
	
	/**
	 * List of button widgets created for the control, used internally
	 */
	buttons: [],
	
	render: function()
	{
		var self = this;
		this.containers.each( function() 
							  { 
								var btn = {};
								btn.btnPrev = new Enjin.UI.Button({text:'<',cls:'element_smallbutton', handler: function() { self.prev(); } });
								btn.btnNext = new Enjin.UI.Button({text:'>',cls:'element_smallbutton', handler: function() { self.next(); } });
								btn.btnFirst = new Enjin.UI.Button({text:'<<',cls:'element_smallbutton', handler: function() { self.first(); } });
								btn.btnLast = new Enjin.UI.Button({text:'>>',cls:'element_smallbutton', handler: function() { self.last(); } });
								btn.btnGo = new Enjin.UI.Button({text:'Go',cls:'element_smallbutton', handler: function() { self.getPage( $(this).closest('.element_pagewidget').find('input[type=text]').val() ); } });
								
								var wrapper = $('<div class="element_pagewidget"></div>');
								for ( var i = 0; i < self.setup.length; i++ )
								{
									switch (self.setup[i])
									{
										case 'first': wrapper.append( btn.btnFirst.render() ); break;
										case 'input':
												wrapper.append( '<span class="text">Page</span><div class="input-text"><input type="text" value="'+self.page+'" maxlength="3"></div>');
												wrapper.append( btn.btnGo.render() );
												wrapper.append( '<span class="text rightmost">of <span class="total">' + self.totalPages + '</span></span>');
												break;
										case 'text':
												wrapper.append( '<span class="text rightmost">Page&nbsp;<span class="page-number"></span>&nbsp;of <span class="total">' + self.totalPages + '</span></span>');
												break;
										case 'prev': wrapper.append( btn.btnPrev.render() ); break;
										case 'next': wrapper.append( btn.btnNext.render() ); break;
										case 'last': wrapper.append( btn.btnLast.render() ); break;
									}	
								}
								
								$(this).append(wrapper);	
								self.buttons.push(btn);
								
								self.setPage(self.page);
							  } 
							);
	
	}

	/**
	 * Called from the outside to reset the values in the controls, does not perform any actual paging actions
	 */
	,setPage: function(page)
	{
		this.page = parseInt(page,10);
		if ( this.page < 1 ) { this.page = 1; }
		if ( this.totalPages && this.page > this.totalPages ) { this.page = this.totalPages; }

		// setup state of the buttons and labels, we always do this in priniciple
		
		this.containers.find('.element_pagewidget input[type=text]').val(this.page);
		this.containers.find('.element_pagewidget .page-number').text(this.page);
		
		for ( var i = 0; i < this.buttons.length; i++ )
		{			
			/*this.buttons[i].btnPrev.enable();
			this.buttons[i].btnFirst.enable();
			this.buttons[i].btnNext.enable();
			this.buttons[i].btnLast.enable();*/
			
			/*if ( this.page == 1 )
			{
				this.buttons[i].btnPrev.disable();
				this.buttons[i].btnFirst.disable();
			}
			if ( this.page == this.totalPages )
			{			
				this.buttons[i].btnNext.disable();
				this.buttons[i].btnLast.disable();
			}
			*/
		}	
		
		this.setVisibility();
	}
	
	/**
	 * Sets the total number of pages available to the paging control
	 */
	,setTotal: function(total)
	{
		this.totalPages = parseInt(total,10);
		this.containers.find('.element_pagewidget span.total').html(this.totalPages);
		this.setVisibility();
	}
	
	/**
	 * Determine if the page widget elements are visible or not
	 */
	,setVisibility: function()
	{
		// if there are no pages to show or only 1, we hide the widget, no need for paging
		if ( this.totalPages <= 1 ) 
		{
			this.containers.find('.element_pagewidget').css('visibility', 'hidden');
		}
		else
		{
			this.containers.find('.element_pagewidget').css('visibility', 'visible');
		}	
	}
	
	/**
	 * Navigate back one page in response to UI button
	 */
	,prev: function()
	{
		this.getPage(this.page-1);
	}
	
	,next: function()
	{
		this.getPage(this.page+1);
	}
	
	,last: function()
	{
		this.getPage(this.totalPages);
	}
	
	,first: function()
	{
		this.getPage(1);
	}
	
	,getPage: function(page)
	{
		this.setPage(page);	
		if ( typeof this.scope == 'object' && typeof this.scope[this.get_page] === 'function' ) { this.scope[this.get_page](this.page); }
	}
}


